window.addEventListener("load",async()=>{const a=JSON.parse(localStorage.getItem("token")||"null");try{const b=await window.MemberStack.onReady;if(b.loggedIn)if(a)window.location.href=`https://tweetnest.io/member/${b.id}`;else{const a=await fetch("https://api.tweetnest.io/api/auth/authorize"),b=await a.json();if(b.status)window.location.href=b.data;else throw new Error(b.message)}}catch(a){console.error(a)}});